import React from 'react';
import Button from 'react-bootstrap/Button';
import {
  TransitionGroup,
  CSSTransition
} from 'react-transition-group'

function SideBar() {
  return(

    <div className='side-bar-wrap'>
      <div className='bar'>
      <TransitionGroup>
          <CSSTransition
          timeout={300}
          classNames='trans'
          >
            <Button variant="transparent">
                HOW TO FIND US
            </Button>
          </CSSTransition>
        </TransitionGroup>
      </div>
    </div>
  );
}

export default SideBar;
